window.bookSummaryJSON = "<p>It's the last weekend of summer break in the small town of Castor, and four teenage friends are about to attend the most popular end-of-summer high-school party in town...with a massive wave of mutated undead about to crash the party. It's <i>The Breakfast Club</i> meets <i>Resident Evil</i> as the teens of Castor fight to stay alive.&nbsp;</p> <p><b>BONUS SHORT STORY:</b> <i>Hissers</i> includes \"Confidentiality\", one of four interlocking stories from <i>The Junkie Quatrain</i> by Peter Clines.</p>"; 
